import React, { Component } from "react";




class FilterButton extends Component {


    render() {
        const ButtonText = this.props.button.label;
        return <button onClick={this.props.buttonHandle} className={this.props.button.status ? 'is-selected' : ''}>{ButtonText}</button>;
    }

}

export default FilterButton;
